import "./Flex.sass";
import "animate.css"
function Flex() {
    const langauges = ["Python", "Java", "C#", "C++", "C"];
    
    return(
        <div>
            <h1 class = "flex introRes">Comfortable with:</h1>
            <h1 class = "flex language animated slideInLeft animate__animated animate__fadeIn animate__infinite"> Java</h1>
        
        </div>
    )
}

export default Flex;
